import React from 'react'
import './styles/App.css'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
  Layout
} from "react-router-dom";
import About from './pages/About';

function App() {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route exact path="/about" element={<About />} />
        </Routes>
      </Layout>
    </Router>
  )

}

export default App;
